import emailjs from '@emailjs/browser';

export const EmailjsPractice = () => {
    const form = useRef();

    const sendEmail = (e) => {
        e.preventDefault();

        emailjs
            .sendForm('service_ix25dr9', 'template_ohy6dpx', form.current, {
                publicKey: 'nzZC9f1fhink2qm3L',
            })
            .then(
                () => {
                    console.log('SUCCESS!');
                },
                (error) => {
                    console.log('FAILED...', error.text);
                },
            );
    };

    return (
        <div className=''>
            
      </div>
    );
};
